import React from 'react';
import {Link} from 'react-router-dom';

const HomePage = ({AppProps}) => {

    const dogs = AppProps.dogs
    return (
        <>
        {console.log(dogs)}
        {dogs.map(d => (
            <div>
               <img src={d.src}/>
               <Link>
                    <h1>{d.name}</h1>
               </Link>
            </div>
        ))}
        </>

    )
}

export default HomePage;
